import React from 'react';
import { Startpage } from './Startpage';
import { Country } from './Country.js';
import { Category } from './Category.js';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

export const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/'>
          <Startpage />
        </Route>
        <Route path='/Category'>
          <Category />
        </Route>
        <Route path='/Country'>
          <Country />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};
